using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class ThreadedRoofModel : Notifier	{		public ThreadedRoofModel()		{					NPS = "";			DEP = "";			HR = "";			DR = "";		}				private string _NPS;		public string NPS			{				get { return _NPS; }				set				{					_NPS = value;					OnPropertyChanged(nameof(NPS));				}			}				private string _DEP;		public string DEP			{				get { return _DEP; }				set				{					_DEP = value;					OnPropertyChanged(nameof(DEP));				}			}				private string _HR;		public string HR			{				get { return _HR; }				set				{					_HR = value;					OnPropertyChanged(nameof(HR));				}			}				private string _DR;		public string DR			{				get { return _DR; }				set				{					_DR = value;					OnPropertyChanged(nameof(DR));				}			}			}}